INSERT INTO `person` VALUES (1,'Vess','Liliana','Raven-haired Liliana uses black mana to reanimate the dead, corrupt the living, and unlock power from death. ','https://img.scryfall.com/cards/art_crop/front/a/1/a1c107c4-bd41-4138-a364-171a444524bd.jpg?1562929115','https://magic.wizards.com/sites/mtg/files/images/wallpaper/Lilinana-Deaths-Majesty_AKH_2560x1600_Wallpaper.jpg','https://mtg.gamepedia.com/Liliana_Vess','https://magic.wizards.com/en/story/planeswalkers/liliana-vess','2019-06-12 14:24:57','2019-06-12 04:27:20'),(2,'Goldmane','Ajani','Ajani is a large one-eyed albino cat warrior, torn between his leonin ferocity and his sense of justice.','https://img.scryfall.com/cards/art_crop/front/7/7/77c7e143-d1d0-4974-93e7-f43e32906536.jpg?1562271060','https://magic.wizards.com/sites/mtg/files/images/wallpaper/Ajani-Strength-of-the-Pride_M20_2560x1600.jpg','https://mtg.gamepedia.com/Ajani_Goldmane',NULL,'2019-06-12 14:24:57','2019-06-12 04:30:49'),(3,'Aminatou','','','https://img.scryfall.com/cards/art_crop/front/c/5/c562ff50-f74b-4311-972a-ba62366411d5.jpg?1561758017','https://magic.wizards.com/sites/mtg/files/images/wallpaper/Aminatou-the-Fateshifter_C18_2560x1600_Wallpaper.jpg','https://mtg.gamepedia.com/Aminatou',NULL,'2019-06-12 14:24:57','2019-06-12 04:31:17'),(4,'Angrath','','','https://img.scryfall.com/cards/art_crop/front/f/1/f17103dd-f31b-4f6e-b2ea-4ea91815bdd6.jpg?1555041190',NULL,NULL,NULL,'2019-06-12 14:24:57','2019-06-12 04:31:33'),(5,'Kord','Arlinn','','https://img.scryfall.com/cards/art_crop/front/c/0/c0369b49-064c-45bc-a2c6-935e6a22be7b.jpg?1557640920',NULL,NULL,NULL,'2019-06-12 14:24:57','2019-06-12 04:31:48'),(6,'Ashiok','','','https://img.scryfall.com/cards/art_crop/front/e/e/ee592de0-5f41-4017-b21d-ec8c65365582.jpg?1557640626',NULL,'https://mtg.gamepedia.com/Ashiok','https://magic.wizards.com/en/story/planeswalkers/ashiok','2019-06-12 14:24:57','2019-06-12 04:32:28'),(7,'Nalaar','Chandra','Chandra is an emotionally charged fire-mage, who prefers t