INSERT INTO `vspack` VALUES (1,'Duel Decks: Elves vs Goblins (2007)','https://magic.wizards.com/en/content/duel-decks-elves-vs-goblins','https://mtg.gamepedia.com/Duel_Decks:_Elves_vs._Goblins','https://cdn1.mtggoldfish.com/images/gf/Duel%2BDecks%253A%2BElves%2Bvs%252E%2BGoblins%2B%255BSEALED%255D.jpg','2019-09-07 08:50:38','2019-09-07 08:58:40'),(2,'Duel Decks: Divine vs. Demonic','https://magic.wizards.com/en/content/duel-decks-divine-vs-demonic','https://mtg.gamepedia.com/Duel_Decks:_Divine_vs._Demonic','https://cdn1.mtggoldfish.com/images/gf/Duel%2BDecks%253A%2BDivine%2Bvs%252E%2BDemonic%2B%255BSEALED%255D.jpg','2019-09-07 08:52:12','2019-09-07 08:58:17'),(3,'Duel Decks: Knights vs. Dragons','https://magic.wizards.com/en/content/duel-decks-knights-vs-dragons','https://mtg.gamepedia.com/Duel_Decks:_Knights_vs._Dragons','https://cdn1.mtggoldfish.com/images/gf/Duel%2BDecks%253A%2BKnights%2Bvs%252E%2BDragons%2B%255BSEALED%255D.jpg','2019-09-07 09:00:28','2019-09-07 09:00:28'),(4,'Duel Decks: Heroes vs. Monsters','https://magic.wizards.com/en/content/duel-decks-heroes-vs-monsters','https://mtg.gamepedia.com/Duel_Decks:_Heroes_vs._Monsters','https://cdn1.mtggoldfish.com/images/gf/Duel%2BDecks%253A%2BHeroes%2Bvs%252E%2BMonsters%2B%255BSEALED%255D.jpg','2019-09-07 09:01:35','2019-09-07 09:01:35'),(5,'Duel Decks: Merfolk vs. Goblins','https://magic.wizards.com/en/products/duel-decks-merfolk-vs-goblins','https://mtg.gamepedia.com/Duel_Decks:_Merfolk_vs._Goblins','https://cdn1.mtggoldfish.com/images/gf/Duel%2BDecks%253A%2BMerfolk%2Bvs%252E%2BGoblins%2B%255BSEALED%255D.jpg','2019-09-07 09:11:55','2019-09-07 09:11:55'),(6,'Duel Decks: Elves vs. Inventors','https://magic.wizards.com/en/products/duel-decks-elves-vs-inventors','https://mtg.gamepedia.com/Duel_Decks:_Elves_vs._Inventors','https://6d4be195623157e28848-7697ece4918e0a73861de0eb37d08968.ssl.cf1.rackcdn.com/162110_200w.jpg','2019-09-07 09:13:40','2019-09-07 09:13:40'),(7,'Duel Decks: Mind vs. Might','https://magic.wizards.com/en/products/duel-decks-mind-might','https://mtg.gamepedia.com/Duel_Decks:_Mind_vs._Might','https://cdn1.mtggoldfish.com/images/gf/Duel%2BDecks%253A%2BMind%2Bvs%252E%2BMight%2B%255BSEALED%255D.jpg','2019-09-07 09:16:55','2019-09-07 09:16:55');
